- input: "TEXT\x1CC00001917\x1CTEXT-00001\x1C\x1CF3XA\x1CThe committee is in receipt
    of the FEC's letter of May 4, 2011, and to address the items raised in that letter,
    today the committee is filing a number of amended reports. Upon researching Item
    1 from the May 4, 2011, letter, the committee discovered that a correction we
    made to our records sometime between Jan. 31, 2011, and April 8, 2011, had the
    effect of causing three transactions, previously reported as unitemized contributions,
    to be subsequently reported as itemized contributions. The correction was that
    we initially overlooked a duplicate record such that we had one record each for
    Debbie Bovee who lived at 4067 E 14 St and Debra Bovee who lived at 4067 East
    14th Street. We combined the records, which caused the discrepancies between reports
    we filed before and after we made the correction. This affected some of the year-to-date
    totals in all reports we have previously filed covering the period from April
    1, 2010, through Dec. 31, 2010, so we are amending all of those reports at this
    time to reflect the corrected information. Upon researching Item 2 from the May
    4, 2011, letter, the committee discovered that we had initially erroneously reported
    an $8,280.37 expenditure to the Parkway Plaza Hotel on May 28, 2010, on Schedule
    H4, Line 21(a). We have since corrected our reporting of that disbursement to
    add it where it belongs, on Schedule B, Line 21(b). This correction affected all
    reports we have filed covering the period from May 1, 2010, through Dec. 31, 2010,
    so we are amending all of those reports at this time to reflect the corrected
    information.  Any payroll related items on Schedule H4 were for the benefit of
    employees that did not spend over 25% of the compensated time on federal activity.\n"
